(this.webpackJsonpchristmas=this.webpackJsonpchristmas||[]).push([[0],{15:function(e,t,i){},16:function(e,t,i){},18:function(e,t,i){},21:function(e,t,i){},23:function(e,t,i){"use strict";i.r(t);var a=i(1),n=i.n(a),s=i(7),o=i.n(s),r=(i(15),i(16),i(0));var h=function(){return Object(r.jsx)("h1",{children:"WHAT\u2019S GOOD KUMA SQUAD!?"})};i(18);var l=function(){return Object(r.jsxs)("div",{id:"hello",children:[Object(r.jsx)("p",{children:"2021 brought several things: more COVID pandemic, more social distancing, and one incredibly forgettable Kumasaka newsletters. But after one long year of waiting, I\u2019M BACK BABY. That\u2019s right folks, your author this year, brought back one year sooner than usual by popular demand (and because my parents forgot -_-) is Jill. In 2022, my family embraced technology to its fullest with solar panels for the house, a new fully electric car, and Fubo TV. We also acquired a younger Japanese brother, which, unlike everything else in this letter, is not a joke! Hanamichi, our cousin from Japan, started living with us in July and has been a great addition to the chaos of our household."}),Object(r.jsx)("h3",{children:"DUBBIE:"}),Object(r.jsx)("p",{children:"My father turned 60 this year and celebrated with the \u201cBandon Boys\u201d which is basically a bad middle- aged boyband that golfs and drinks whiskey. Dubbie also went flyfishing for the first time in 40 years with his favorite brother which he describes as, \u201ctruly one of the biggest thrills this year.\u201d Oh, to be old and enjoying \u201cthrilling\u201d activities like golfing and fly fishing. He is enjoying his transition to part-time dermatologist at Valley Medical (as if he ever worked in the first place), golfing, and cheering for Seattle sports teams."}),Object(r.jsx)("h3",{children:"MUBBIE:"}),Object(r.jsx)("p",{children:"Mother is as active as ever. She enjoys teaching her Sunday school lessons featuring embarrassing stories of her daughters and serving as a deacon. Throughout this year, you could find Mubbie either cheering for the Mariners in the living room or golfing with Auntie Wendy or Julie or Leslie or Marji or all the above. Her 2022 highlights include taking selfies with Stormtroopers on Rise of the Resistance, watching kdrama, and spending time with her favorite daughter (not to be confused with the other daughter who lives with her, Kellie)."}),Object(r.jsx)("h3",{children:"KIWI:"}),Object(r.jsx)("p",{children:"Everyone\u2019s least favorite sister had an eventful year: she saw Twice twice, caught COVID in Toronto, and got a job, got a job, quit a job, and got a job (if you\u2019re confused by that last part then that makes two of us). She is now working from home as a software engineer for a shipping tracking company called Logixboard. Kellie often complains that her one and only in-office coworker smells bad and makes too much noise, but Luna claims otherwise. Kiwi is also tutoring students in the computer science boot camp she completed last year. Overall, she stays busy buying Pok\xe9mon cards, bullet journaling, and hanging out with friends."}),Object(r.jsx)("h3",{children:"TOW TOW:"}),Object(r.jsx)("p",{children:"Lisa is pretending to study at OHSU in her second year of Medical School. She is also single- handedly solving medical racism and finding the cure to cancer, or at least that\u2019s what it seems like. Tow Tow is the swollest in the PNW and can squat the equivalent of two Kiwi\u2019s + one Luna, you do the math. This year, she moved to a new house, led OHSU\u2019s Health Care Equity Fair, and stitched up a knife wound! She also fulfilled her vigilante dreams and almost died, but that\u2019s a story for another time."}),Object(r.jsx)("h3",{children:"JEEL:"}),Object(r.jsx)("p",{children:"Onto the important stuff. This year I saw Twice once, travelled across the country with my father (and survived!), and skydived in Hawaii. In January, I moved to Atlanta for six months to work for the CDC. While in Atlanta, I also started working as a barista where I \u201cdeveloped a passion for coffee\u201d which my family interprets as \u201cbecame a coffee snob.\u201d I am currently pursuing an original and very foreign profession to our family (medicine) and working as a medical scribe for the best doctor in Des Moines (ily Dr. Okamoto)."}),Object(r.jsx)("h3",{children:"LUNA:"}),Object(r.jsx)("p",{children:"Luna is\u2026 the same: fuzzy, lazy, and stinky. Her hobbies of 2022 included harassing children, barking at cats, and scratching herself."}),Object(r.jsx)("p",{children:"Well, that\u2019s a wrap people! If you enjoyed this year\u2019s newsletter, please kindly remind my supervisors to give their workers a raise. Thanks again for tuning in and happy holidays!"}),Object(r.jsx)("p",{style:{textAlign:"center"},children:"With love,"}),Object(r.jsx)("p",{style:{textAlign:"center"},children:"The Kumasakas"})]})};var c=function(){return Object(r.jsxs)("div",{className:"App",children:[Object(r.jsx)(h,{}),Object(r.jsx)(l,{})]})},d=(i(19),i(20),i(8)),u=i.n(d),f=i(9),g=i.n(f),b=(i(21),i(10)),y=i.n(b);u.a.use(g.a),o.a.render(Object(r.jsx)(n.a.StrictMode,{children:Object(r.jsxs)("div",{style:{background:"#282c34"},children:[Object(r.jsx)(y.a,{snowflakeCount:200,style:{position:"fixed",width:"100%",height:"100%"}}),Object(r.jsx)(c,{})]})}),document.getElementById("root"))}},[[23,1,2]]]);
